import React from 'react';
import UserTable from './UserTable';
import WorkGrid from './WorkGrid';


const App = () => {
  return (
    <div className="app-container">
      <div className="user-table-container">
        <UserTable />
      </div>
      <div className="work-grid-container">
        <WorkGrid />
      </div>
    </div>
  );
};

export default App;
